var arrLeague = [34,'意大利甲组联赛','意大利甲組聯賽','Italian Serie A','2014-2015','#0088FF','league_match/images/20140107211253.jpg',38,38,'意甲','意甲','ITA D1','　　意大利足球甲级联赛共由20支球队组成，采取双循环赛制（每支球队分别以主、客场身份和其他球队交锋两次）。单场比赛积分计算方法是胜者得3分、负者得0分、平局则双方各得1分，赛季末按累计积分高低排名。如果积分相同则先比互相之间战绩，然后顺序以互相间淨胜球，互相间进球数，联赛总淨胜球，联赛进球数的顺序决定名次。&nbsp;　<br/>　　联赛前两名直接参加下赛季冠军联赛，第三名参加冠军联赛附加赛，第四、五名参加下赛季欧霸杯联赛（意大利盃赛冠军也可以参加欧霸杯联赛，如果意大利盃冠军已经取得欧战资格，则其名额将让给盃赛亚军）。另外，本赛季意甲联赛规定升3降3，联赛排名榜尾的3支球队下赛季将降到乙级。'];
